const Index = () => {
  return (
    <div>
      <p className='mt-6 text-center'>
        Ol√° Semana Fullstack Master
      </p>
      <div>         
        <Link href='/sobre'>
          <a>Sobre</a>
        </Link>
        <Link href='/contato'>
          <a>Contato</a>
        </Link>
        <Link href='/pesquisa'>
          <a>Pesquisa</a>
        </Link>
      </div>
    </div>
    )
}

export default Index;
